function sumPrimes(num) {
  let primeArr = [2, 3, 5];
  let sumPrimes = 0;
  let isPrimeNum = false;
  // Check if number isPrime
  function isPrime(num) {
    let prime = num != 1;
    for(let i=2; i<num; i++) {
        if(num % i == 0) {
            prime = false;
            break;
        }
    }
    return prime;
  }
  // Build prime numbers arr
  for(let i = 6; i <= num; i++) {
    isPrimeNum = isPrime(i);
    if(isPrimeNum) {
      primeArr.push(i);
    }
  }
  // Sum primeArr
  for(let y = 0; y < primeArr.length; y++) {
    sumPrimes += primeArr[y];
  }
  return sumPrimes;
}

